sys_variable_value.value:
(function execute(inputs, outputs) {
var appName = inputs.string;
//var str = appName.replace(/\s/g, '');
var sp = inputs.split;

var partsArray = appName.split(sp);

outputs.label1 = partsArray[0].replace(/\s/g, '');
outputs.val1 = partsArray[1];

})(inputs, outputs);

